import React from 'react'
import styled from 'styled-components'
export default function Header() {
  return (
    <Head>
      <div>Book</div>
      <ul>
        <li>책 검색</li>
        <li>새 소식</li>
        <li>커머스</li>
        <li>서비스</li>
      </ul>
    </Head>
  )
}
const Head = styled.div`
  position: absolute;
  top: 0;
`
